import { Grid, TextField } from '@material-ui/core';

const SignUp = () => {
	return (
		<Grid 
			container 
			// columnSpacing={{ xs : 1, sm : 2, md : 3 }} 
		>
			<Grid item xs={6}>
				<Item>1</Item>
			</Grid>
			<Grid item xs={6}>
			<TextField 
				id="outlined-basic" 
				label="last name" 
				variant="outlined" 
			/>
			</Grid>

			<TextField 
				id="outlined-basic" 
				label="first name" 
				variant="outlined" 
			/>
			{/* <TextField 
				id="outlined-basic" 
				label="last name" 
				variant="outlined" 
			/> */}
		</Grid>
	);
};

export default SignUp;
